import React from 'react';
import { Button, Form } from 'semantic-ui-react';

const TournamentFormComponent = () => {

    const onSubmit = (event) => {
        console.log(event)
    }

    return <Form>
        <Form.Group widths='equal'>
            <Form.Field
                label = 'Percent Cooperate Agent'
                control = 'input'
                type = 'number'
                max = {100}
                min  = {0}
            />
            <Form.Field
                label = 'Percent Defect Agent'
                control = 'input'
                type = 'number'
                max = {100}
                min  = {0}
            />            
            <Form.Field
                label = 'Percent Copy Agent'
                control = 'input'
                type = 'number'
                max = {100}
                min  = {0}
            />
            <Form.Field
                label = 'Percent Grudge Agent'
                control = 'input'
                type = 'number'
                max = {100}
                min  = {0}
            />
            <Form.Field
                label = 'Percent Custom Agent'
                control = 'input'
                type = 'number'
                max = {100}
                min  = {0}
            />
        </Form.Group>
        <Button type='submit' onSubmit = {onSubmit}>Load Tournament Visual</Button>
    </Form>

}

export default TournamentFormComponent;
